import React from 'react';
import { Grid,Paper, TextField } from '@material-ui/core'
import Controls from '../../../components/controls/Controls';

function Login() {
    const gridStyle = {paddingLeft:'170px', margin:'0px'}
    const img = {position:'center', padding:'0px', with:'120px', margin:'0rem'};
    const paperStyle={padding:'20px', height:'75vh', width:300, margin:"50px"}
    const btnstyle={margin:'8px 0'}

    return (
        <>
            <Grid style={gridStyle}>
                <Paper style={paperStyle}>
                    <Grid align='center'>
                        <img style={img} src='logo.png'/>
                        <h2>ENTRAR</h2>
                    </Grid>
                    <TextField label='Username' placeholder='Enter username' fullWidth required/><br/><br/>
                    <TextField label='Password' placeholder='Enter password' type='password' fullWidth required/>
                    <br/><br/>
                    <Controls.Checkbox 
                    name='checkedB'
                    label="Remember me"
                /><br/><br/>
                    <Controls.Button 
                        color='primary' 
                        variant="contained" 
                        text='ENTRAR'
                        style={btnstyle} fullWidth
                    />
                </Paper>
            </Grid>
        </>
    );
}

export default Login;
